import { getESRGANModelDefinition, } from '../../../packages/shared/src/esrgan/esrgan';
import { NAME, VERSION, } from './constants.generated';
const getModelDefinition = (scale, modelPath, architecture = 'rdn') => getESRGANModelDefinition({
    scale,
    path: `models/${modelPath}/model.json`,
    name: NAME,
    version: VERSION,
    meta: {
        dataset: 'div2k',
        architecture,
    },
});
export default getModelDefinition;
